import React from 'react'
let style = {
    textAlign : 'center',
    width : '100%',
    height : '100vh'
}
let color = '#'
let possible = '0123456789abcdef'
for (let i = 1; i < 6; i++) {
  color += Math.floor(Math.random() * possible.length) 
}
function RandomColor() {
  return (
    <div style={style}>
      <h3>{color}</h3>
    </div>
  )
}

export default RandomColor
